import React, { useState } from 'react';
import './Home.css';

function Home() {
  const [reminders, setReminders] = useState([]);
  const [agenda, setAgenda] = useState([]);
  const [newReminder, setNewReminder] = useState('');
  const [newAgendaItem, setNewAgendaItem] = useState('');

  const addReminder = () => {
    setReminders([...reminders, newReminder]);
    setNewReminder('');
  };

  const addAgendaItem = () => {
    setAgenda([...agenda, newAgendaItem]);
    setNewAgendaItem('');
  };

  return (
    <div className="home-container">
      <div className="greeting">
        <h2>Good night, Kaan</h2>
      </div>
      <div className="content">
        <div className="section recents">
          <div className="section-header">
            <h3>Recents</h3>
            <div className="section-controls">
              <i className="fas fa-expand-arrows-alt"></i>
              <div className="dropdown">
                <i className="fas fa-ellipsis-v"></i>
                <div className="dropdown-content">
                  <p>More Settings</p>
                </div>
              </div>
            </div>
          </div>
          <ul>
            {reminders.map((reminder, index) => (
              <li key={index}>{reminder}</li>
            ))}
          </ul>
          <input
            type="text"
            value={newReminder}
            onChange={(e) => setNewReminder(e.target.value)}
            placeholder="Add a new reminder"
          />
          <button onClick={addReminder}>Add Reminder</button>
        </div>
        <div className="section agenda">
          <h3>Agenda</h3>
          <ul>
            {agenda.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>
          <input
            type="text"
            value={newAgendaItem}
            onChange={(e) => setNewAgendaItem(e.target.value)}
            placeholder="Add a new agenda item"
          />
          <button onClick={addAgendaItem}>Add Agenda Item</button>
        </div>
        <div className="section my-work">
          <h3>My Work</h3>
          {/* My Work içeriği buraya gelecek */}
        </div>
        <div className="section assigned-to-me">
          <h3>Assigned to me</h3>
          {/* Assigned to me içeriği buraya gelecek */}
        </div>
      </div>
    </div>
  );
}

export default Home;
